  };

  const handleTelegramClick = () => {
    window.open("https://t.me/yourusername", "_blank");
  };

  return (
    <div className="floating-icons">
      <button onClick={handleCalculatorClick} className="icon" title="Расчет стоимости">
        <FontAwesomeIcon icon={faCalculator} size="2x" />
      </button>
      <button onClick={handleTelegramClick} className="icon" title="Связь в Telegram">
        <FontAwesomeIcon icon={faTelegramPlane} size="2x" />
      </button>
    </div>
  );
};

export default FloatingIcons;
